import React from 'react'
import { Box, Heading } from 'grommet';
import Caroussel from './Caroussel';

export const Portfolio = () => {
    return (
       <Box justify='around' direction='row' background='light-3' height='large' >
            <Heading>Portfolio</Heading>
            <Caroussel/>
       </Box>
    )
}
